(260, NULL, '', '{\"vi\":\"S\\u00e1ch m\\u1edbi nh\\u1ea5t\"}', '{\"vi\":\"N\\u1ebfu b\\u1ea1n \\u0111ang \\u0111i\\u1ec1u h\\u00e0nh nh\\u00e0 s\\u00e1ch v\\u00e0 mu\\u1ed1n \\u0111a d\\u1ea1ng h\\u00f3a xu\\u1ea5t b\\u1ea3n ph\\u1ea9m \\u0111\\u1ebfn kh\\u00e1ch h\\u00e0ng\\u2026, ch\\u00fang t\\u00f4i lu\\u00f4n \\u0111\\u1ed3ng h\\u00e0nh, h\\u1ed7 tr\\u1ee3 v\\u00e0 cung c\\u1ea5p xu\\u1ea5t b\\u1ea3n ph\\u1ea9m c\\u00e1c Nh\\u00e0 s\\u00e1ch tr\\u00ean to\\u00e0n qu\\u1ed1c v\\u1edbi ch\\u00ednh s\\u00e1ch \\u0111\\u1ea1i l\\u00fd t\\u1ed1t v\\u00e0 chi\\u1ebft kh\\u1ea5u h\\u1ea5p d\\u1eabn.\"}', '{\"vi\":\"<p><span style=\\\"font-size:24px;\\\">Nh\\u00e0 s\\u00e1ch<\\/span><\\/p>\\r\\n\\r\\n<p><span style=\\\"font-size:16px;\\\">L\\u00e0 \\u0111\\u01a1n v\\u1ecb ho\\u1ea1t \\u0111\\u1ed9ng l\\u00e2u n\\u0103m trong l\\u0129nh v\\u1ef1c xu\\u1ea5t b\\u1ea3n, Nh\\u00e0 xu\\u1ea5t b\\u1ea3n H\\u1ed9i nh\\u00e0 v\\u0103n \\u0111\\u00e3 x\\u00e2y d\\u1ef1ng \\u0111\\u01b0\\u1ee3c m\\u1ed9t m\\u1ea1ng l\\u01b0\\u1edbi c\\u00e1c nh\\u00e0 s\\u00e1ch, \\u0111\\u1ea1i l\\u00fd, nh\\u00e0 ph\\u00e2n ph\\u1ed1i tr\\u00ean to\\u00e0n qu\\u1ed1c v\\u1edbi s\\u1ed1 l\\u01b0\\u1ee3ng \\u0111\\u1ed9c gi\\u1ea3, \\u0111\\u01a1n h\\u00e0ng \\u1ed5n \\u0111\\u1ecbnh, c\\u00e1c \\u0111\\u1ea7u s\\u00e1ch ch\\u1ea5t l\\u01b0\\u1ee3ng \\u0111\\u01b0\\u1ee3c b\\u1ea1n \\u0111\\u1ecdc \\u0111\\u00e1nh gi\\u00e1 cao. N\\u1ebfu b\\u1ea1n \\u0111ang \\u0111i\\u1ec1u h\\u00e0nh nh\\u00e0 s\\u00e1ch v\\u00e0 mu\\u1ed1n \\u0111a d\\u1ea1ng h\\u00f3a xu\\u1ea5t b\\u1ea3n ph\\u1ea9m \\u0111\\u1ebfn kh\\u00e1ch h\\u00e0ng\\u2026, ch\\u00fang t\\u00f4i lu\\u00f4n \\u0111\\u1ed3ng h\\u00e0nh, h\\u1ed7 tr\\u1ee3 v\\u00e0 cung c\\u1ea5p xu\\u1ea5t b\\u1ea3n ph\\u1ea9m c\\u00e1c Nh\\u00e0 s\\u00e1ch tr\\u00ean to\\u00e0n qu\\u1ed1c v\\u1edbi ch\\u00ednh s\\u00e1ch \\u0111\\u1ea1i l\\u00fd t\\u1ed1t v\\u00e0 chi\\u1ebft kh\\u1ea5u h\\u1ea5p d\\u1eabn.<\\/span><\\/p>\"}', 'new-documents', NULL, NU