(261, NULL, '', '{\"vi\":\"NH\\u00c0 XU\\u1ea4T B\\u1ea2N H\\u1ed8I NH\\u00c0 V\\u0102N\"}', '{\"vi\":\"Nha\\u0300 xu\\u00e2\\u0301t ba\\u0309n H\\u00f4\\u0323i Nha\\u0300 v\\u0103n \\u0111\\u01b0\\u01a1\\u0323c tha\\u0300nh l\\u00e2\\u0323p n\\u0103m 1957 cu\\u0300ng v\\u01a1\\u0301i s\\u01b0\\u0323 ra \\u0111\\u01a1\\u0300i cu\\u0309a H\\u00f4\\u0323i Nha\\u0300 v\\u0103n Vi\\u00ea\\u0323t Nam. Qua h\\u01a1n 60 n\\u0103m hi\\u0300nh tha\\u0300nh va\\u0300 pha\\u0301t tri\\u00ea\\u0309n cu\\u0300ng v\\u01a1\\u0301i nh\\u01b0\\u0303ng bi\\u00ea\\u0301n chuy\\u00ea\\u0309n cu\\u0309a \\u0111\\u00e2\\u0301t n\\u01b0\\u01a1\\u0301c, nhi\\u00ea\\u0300u th\\u00ea\\u0301 h\\u00ea\\u0323 nha\\u0300 v\\u0103n va\\u0300 ca\\u0301c ca\\u0301n b\\u00f4\\u0323 v\\u0103n ho\\u0323c c\\u00f4ng ta\\u0301c ta\\u0323i Nxb H\\u00f4\\u0323i Nha\\u0300 v\\u0103n \\u0111a\\u0303 kh\\u00f4ng ng\\u01b0\\u0300ng c\\u00f4\\u0301ng hi\\u00ea\\u0301n ta\\u0300i n\\u0103ng, c\\u00f4ng s\\u01b0\\u0301c \\u0111\\u00ea\\u0309 x\\u00e2y d\\u01b0\\u0323ng n\\u00ean m\\u00f4\\u0323t \\u0111i\\u0323a chi\\u0309 xu\\u00e2\\u0301t ba\\u0309n uy ti\\u0301n tr\\u00ean ca\\u0309 n\\u01b0\\u01a1\\u0301c.\"}', '{\"vi\":\"<p>Nha\\u0300 xu\\u00e2\\u0301t ba\\u0309n H\\u00f4\\u0323i Nha\\u0300 v\\u0103n \\u0111\\u01b0\\u01a1\\u0323c tha\\u0300nh l\\u00e2\\u0323p n\\u0103m 1957 cu\\u0300ng v\\u01a1\\u0301i s\\u01b0\\u0323 ra \\u0111\\u01a1\\u0300i cu\\u0309a H\\u00f4\\u0323i Nha\\u0300 v\\u0103n Vi\\u00ea\\u0323t Nam. Qua h\\u01a1n 60 n\\u0103m hi\\u0300nh tha\\u0300nh va\\u0300 pha\\u0301t tri\\u00ea\\u0309n cu\\u0300ng v\\u01a1\\u0301i nh\\u01b0\\u0303ng bi\\u00ea\\u0301n chuy\\u00ea\\u0309n cu\\u0309a \\u0111\\u00e2\\u0301t n\\u01b0\\u01a1\\u0301c, nhi\\u00ea\\u0300u th\\u00ea\\u0301 h\\u00ea\\u0323 nha\\u0300 v\\u0103n va\\u0300 ca\\u0301c ca\\u0301n b\\u00f4\\u0323 v\\u0103n ho\\u0323c c\\u00f4ng ta\\u0301c ta\\u0323i Nxb H\\u00f4\\u0323i Nha\\u0300 v\\u0103n \\u0111a\\u0303 kh\\u00f4ng ng\\u01b0\\u0300ng c\\u00f4\\u0301ng hi\\u00ea\\u0301n ta\\u0300i n\\u0103ng, c\\u00f4ng s\\u01b0\\u0301c \\u0111\\u00ea\\u0309 x\\u00e2y d\\u01b0\\u0323ng n\\u00ean m\\u00f4\\u0323t \\u0111i\\u0323a chi\\u0309 xu\\u00e2\\u0301t ba\\u0309n uy ti\\u0301n tr\\u00ean ca\\u0309 n\\u01b0\\u01a1\\u0301c.<\\/p>\\r\\n\\r\\n<p>Trong h\\u01a1n 60 n\\u0103m, Nxb \\u0111\\u00e3 gi\\u1edbi thi\\u1ec7u c\\u00e1c t\\u00e1c ph\\u1ea9m xu\\u00e2\\u0301t s\\u0103\\u0301c t\\u1eeb 15 ng\\u00f4n ng\\u1eef c\\u1ee7a h\\u01a1n 40 n\\u01b0\\u1edbc tr\\u00ean th\\u1ebf gi\\u1edbi. T\\u01b0\\u0300 nh\\u01b0\\u0303ng n\\u0103m 1980 - 1990, Nxb \\u0111a\\u0303 co\\u0301 s\\u01b0\\u0323 h\\u1ee3p t\\u00e1c ch\\u1eb7t ch\\u1ebd v\\u1edbi Nxb C\\u1ea7u V\\u1ed3ng (Li\\u00ean X\\u00f4 c\\u0169), Nxb Sviat (Bungari); \\u0111\\u00f4\\u0300ng th\\u01a1\\u0300i lu\\u00f4n co\\u0301 s\\u01b0\\u0323 k\\u00ea\\u0301t n\\u00f4\\u0301i v\\u1edbi \\u0110\\u1ea1i s\\u1ee9 qu\\u00e1n Ph\\u00e1p, C\\u01a1 quan HCR c\\u1ee7a LHQ t\\u1ea1i Vi\\u1ec7t Nam, Qu\\u1ef9 Ford (M\\u1ef9), Qu\\u1ef9 Toyota (Nh\\u1eadt) v\\u00e0 c\\u00e1c \\u0110\\u1ea1i s\\u1ee9 qu\\u00e1n: Ph\\u1ea7n Lan, \\u0110an M\\u1ea1ch, Ba Lan, H\\u00e0n Qu\\u1ed1c, Nga, Th\\u1ee5y \\u0110i\\u1ec3n\\u2026 \\u0111\\u00ea\\u0309 t\\u00f4\\u0309 ch\\u01b0\\u0301c ca\\u0301c cu\\u00f4\\u0323c trao \\u0111\\u00f4\\u0309i, giao l\\u01b0u v\\u0103n ho\\u0301a gi\\u01b0\\u0303a ca\\u0301c qu\\u00f4\\u0301c gia. Nxb H\\u00f4\\u0323i Nha\\u0300 v\\u0103n l\\u00e0 \\u0111\\u01a1n vi\\u0323 c\\u00f3 s\\u00f4\\u0301 l\\u01b0\\u01a1\\u0323ng ta\\u0301c ph\\u00e2\\u0309m \\u0111\\u01b0\\u01a1\\u0323c chuy\\u00ea\\u0309n ng\\u01b0\\u0303 l\\u01a1\\u0301n nh\\u00e2\\u0301t, gi\\u1edbi thi\\u1ec7u m\\u1ed9t c\\u00e1ch h\\u1ec7 th\\u1ed1ng nh\\u1eefng t\\u00e1c gi\\u1ea3 \\u0111o\\u1ea1t gi\\u1ea3i Nobel v\\u1ec1 v\\u0103n h\\u1ecdc va\\u0300 nh\\u1eefng ki\\u1ec7t t\\u00e1c v\\u0103n h\\u1ecdc th\\u1ebf gi\\u1edbi. B\\u00ean ca\\u0323nh \\u0111o\\u0301, Nxb lu\\u00f4n la\\u0300 \\u0111\\u01a1n vi\\u0323 \\u0111\\u01b0\\u0301ng \\u0111\\u00e2\\u0300u trong vi\\u1ec7c tuy\\u1ec3n ch\\u1ecdn, s\\u01b0u t\\u1ea7m bi\\u00ean so\\u1ea1n, gi\\u1edbi thi\\u1ec7u th\\u00e0nh t\\u1ef1u c\\u1ee7a n\\u1ec1n v\\u0103n h\\u1ecdc Vi\\u1ec7t Nam xuy\\u00ean su\\u1ed1t t\\u1eeb th\\u1ebf k\\u1ef7 X \\u0111\\u1ebfn nay.<\\/p>\\r\\n\\r\\n<p>Trong do\\u0300ng cha\\u0309y s\\u00f4i \\u0111\\u00f4\\u0323ng cu\\u0309a li\\u0323ch s\\u01b0\\u0309 v\\u0103n ho\\u0323c Vi\\u00ea\\u0323t Nam, chu\\u0301ng t\\u00f4i lu\\u00f4n n\\u00f4\\u0303 l\\u01b0\\u0323c hoa\\u0300n tha\\u0300nh t\\u00f4\\u0301t s\\u01b0\\u0301 m\\u00ea\\u0323nh cu\\u0309a mi\\u0300nh \\u0111\\u00f4\\u0301i v\\u01a1\\u0301i nh\\u01b0\\u0303ng mong mu\\u1ed1n cu\\u0309a b\\u1ea1n \\u0111\\u1ecdc trong va\\u0300 ngoa\\u0300i n\\u01b0\\u01a1\\u0301c, th\\u00ea\\u0309 hi\\u00ea\\u0323n qua t\\u01b0\\u0300ng \\u00e2\\u0301n ph\\u00e2\\u0309m mang th\\u01b0\\u01a1ng hi\\u00ea\\u0323u Nha\\u0300 xu\\u00e2\\u0301t ba\\u0309n H\\u00f4\\u0323i Nha\\u0300 v\\u0103n.<\\/p>\"}', 'best-sell', NULL, '/data/file/2/vietvadoc-chuyendemuaxuan.png', NULL, NULL, NULL, '{\"vi\":\"Xem th\\u00eam\"}', NULL, NULL, 4, 'deactive', NULL, 2, 36, '2024-04-25 22:02:56', '2025-08-15 08:29:53'),
