(712, 138, 'intro', '{\"vi\":\"Quy tr\\u00ecnh mua Ebook\"}', '{\"vi\":null}', '{\"vi\":\"<p style=\\\"margin-top:8px; margin-bottom:8px\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">\\u0110\\u0103ng nh\\u1eadp ---<\\/span><font face=\\\"Times New Roman, serif\\\">&nbsp;<\\/font><font face=\\\"Times New Roman, serif\\\">Mua Ebook ---<\\/font><font face=\\\"Times New Roman, serif\\\">&nbsp;\\u0110\\u1ecdc Ebook<\\/font><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><strong><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">1. \\u0110\\u0103ng nh\\u1eadp<\\/span><\\/span><\\/span><\\/strong><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- T\\u1ea1i giao di\\u1ec7n trang S\\u00e1ch \\u0111i\\u1ec7n t\\u1eed, \\u0111\\u1ed9c gi\\u1ea3 ch\\u1ecdn n\\u00fat \\u201cT\\u00e0i kho\\u1ea3n\\u201d (g\\u00f3c tr\\u00ean c\\u00f9ng ph\\u1ea3i).<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\"><img alt=\\\"\\\" src=\\\"\\/data\\/other\\/2\\/tin-tuc\\/image2.png\\\" style=\\\"width: 100%;\\\" \\/><\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><font face=\\\"Times New Roman, serif\\\"><span style=\\\"font-size: 18.6667px;\\\"><i>Ch\\u1ecdn \\u0111\\u0103ng nh\\u1eadp, \\u0111\\u0103ng k\\u00fd<\\/i><\\/span><\\/font><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- N\\u1ebfu \\u0111\\u1ed9c gi\\u1ea3 \\u0111\\u00e3 c\\u00f3 t\\u00e0i kho\\u1ea3n, ch\\u1ecdn n\\u00fat \\u201c\\u0110\\u0103ng nh\\u1eadp\\u201d, \\u0111i\\u1ec1n c\\u00e1c th\\u00f4ng tin Email v\\u00e0 m\\u1eadt kh\\u1ea9u \\u0111\\u1ec3 \\u0111\\u0103ng nh\\u1eadp v\\u00e0o h\\u1ec7 th\\u1ed1ng.<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\"><img alt=\\\"\\\" src=\\\"\\/data\\/other\\/2\\/tin-tuc\\/2.png\\\" style=\\\"width: 50%;\\\" \\/><\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><em><font face=\\\"Times New Roman, serif\\\"><span style=\\\"font-size: 18.6667px;\\\">\\u0110\\u0103ng nh\\u1eadp b\\u1eb1ng \\\"t\\u00e0i kho\\u1ea3n\\\" \\u0111\\u00e3 \\u0111\\u0103ng k\\u00fd ho\\u1eb7c \\\"\\u0111\\u0103ng nh\\u1eadp v\\u1edbi google\\\"<\\/span><\\/font><\\/em><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><strong><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">2. Mua Ebook<\\/span><\\/span><\\/span><\\/strong><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">--- \\u0110\\u1ed9c gi\\u1ea3 ch\\u1ecdn n\\u00fat <strong>Mua Ebook<\\/strong> t\\u1ea1i s\\u00e1ch c\\u1ea7n mua <\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">---&nbsp;X\\u00e1c nh\\u1eadn thanh to\\u00e1n b\\u1eb1ng:<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li style=\\\"margin-top: 8px; margin-bottom: 8px;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">Ch\\u1ecdn&nbsp;<strong>Chuy\\u1ec3n kho\\u1ea3n:&nbsp;<\\/strong>Xu\\u1ea5t hi\\u1ec7n th\\u00f4ng tin v\\u00e0 m\\u00e3 QR \\u0111\\u1ec3 chuy\\u1ec3n kho\\u1ea3n, qu\\u00fd kh\\u00e1ch vui l\\u00f2ng nh\\u1eadp n\\u1ed9i dung chuy\\u1ec3n kho\\u1ea3n. Sau khi chuy\\u1ec3n kho\\u1ea3n th\\u00e0nh c\\u00f4ng b\\u1ea5m n\\u00fat \\\"<strong>X\\u00e1c nh\\u1eadn \\u0111\\u00e3 chuy\\u1ec3n kho\\u1ea3n<\\/strong>\\\".<\\/span><\\/span><\\/span><\\/li>\\r\\n\\t<li style=\\\"margin-top: 8px; margin-bottom: 8px;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">Ch\\u1ecdn<strong> T\\u00e0i kho\\u1ea3n v\\u00ed<\\/strong>&nbsp;(n\\u1ebfu c\\u00f3 s\\u1ed1 d\\u01b0 \\u0111\\u1ee7 thanh to\\u00e1n)<\\/span><\\/span><\\/span><\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">---&nbsp;Sau khi mua Ebook th\\u00e0nh c\\u00f4ng, b\\u1ea5m v\\u00e0o n\\u00fat<strong>&nbsp;\\u0110\\u1ecdc s\\u00e1ch<\\/strong>&nbsp;\\u0111\\u1ec3 \\u0111\\u1ecdc Ebook b\\u1ea3n \\u0111\\u1ea7y \\u0111\\u1ee7.<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\"><img alt=\\\"\\\" src=\\\"\\/data\\/other\\/2\\/tin-tuc\\/image3.png\\\" style=\\\"max-width: 100%; \\\" \\/><\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px;\\\">&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><strong><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">3. N\\u1ea1p ti\\u1ec1n v\\u00e0o v\\u00ed (S\\u1eed d\\u1ee5ng mua s\\u00e1ch tr\\u00ean trang)<\\/span><\\/span><\\/span><\\/strong><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- Sau khi \\u0111\\u00e3 \\u0111\\u0103ng nh\\u1eadp th\\u00e0nh c\\u00f4ng v\\u00e0o h\\u1ec7 th\\u1ed1ng, \\u0111\\u1ed9c gi\\u1ea3 th\\u1ef1c hi\\u1ec7n ch\\u1ecdn n\\u00fat <strong>\\u201cTrang c\\u00e1 nh\\u00e2n\\u201d<\\/strong> th\\u00f4ng qua t\\u00ean t\\u00e0i kho\\u1ea3n (g\\u00f3c tr\\u00ean c\\u00f9ng tay ph\\u1ea3i)<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\"><img alt=\\\"\\\" src=\\\"\\/data\\/other\\/2\\/tin-tuc\\/image1.png\\\" style=\\\"width: 100%;\\\" \\/><\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- N\\u1ea1p ti\\u1ec1n t\\u00e0i kho\\u1ea3n: t\\u1ea1i trang th\\u00f4ng tin c\\u00e1 nh\\u00e2n, \\u0111\\u1ed9c gi\\u1ea3 ch\\u1ecdn n\\u00fat <strong>\\u201cN\\u1ea1p ti\\u1ec1n\\u201d<\\/strong>, t\\u1ea1i \\u0111\\u00e2y s\\u1ebd c\\u00f3 2 h\\u00ecnh th\\u1ee9c n\\u1ea1p ti\\u1ec1n, n\\u1ea1p ti\\u1ec1n th\\u00f4ng qua v\\u00ed VNPay ho\\u1eb7c n\\u1ea1p ti\\u1ec1n th\\u00f4ng qua h\\u00ecnh th\\u1ee9c chuy\\u1ec3n kho\\u1ea3n.<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top: 8px; margin-bottom: 8px; text-align: center;\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\"><img alt=\\\"\\\" src=\\\"\\/data\\/other\\/2\\/tin-tuc\\/image4.png\\\" style=\\\"max-width: 100%; \\\" \\/><\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- \\u0110\\u1ed9c gi\\u1ea3 th\\u1ef1c hi\\u1ec7n <strong><em>nh\\u1eadp s\\u1ed1 ti\\u1ec1n c\\u1ea7n n\\u1ea1p<\\/em><\\/strong>, sau \\u0111\\u00f3 ch\\u1ecdn ph\\u01b0\\u01a1ng th\\u1ee9c c\\u1ea7n thanh to\\u00e1n.<\\/span><\\/span><\\/span><\\/p>\\r\\n\\r\\n<p style=\\\"margin-top:8px; margin-bottom:8px\\\"><span style=\\\"font-size:14pt\\\"><span style=\\\"line-height:115%\\\"><span style=\\\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\\\">- Sau khi h\\u1ec7 th\\u1ed1ng x\\u00e1c th\\u1ef1c n\\u1ea1p ti\\u1ec1n th\\u00e0nh c\\u00f4ng, s\\u1ed1 ti\\u1ec1n s\\u1ebd \\u0111\\u01b0\\u1ee3c c\\u1ed9ng v\\u00e0o t\\u00e0i kho\\u1ea3n.<\\/span><\\/span><\\/span><\\/p>\"}', NULL, NULL, NULL, 'active', NULL, NULL, 'quy-trinh-mua-ebook', 1, 1, 0, NULL, NULL, '0', '0', 0, '2024-08-05 11:05:57', NULL, NU