(62, 'KHÚC HÁT MIỀN TRỜI (Bản điện tử dành cho khách đọc thử)', '\"Khúc hát miền Trời\" là một tập thơ thiếu nhi đặc biệt của nhà thơ Phạm Vân Anh, như một bản giao hưởng ngọt ngào giữa lịch sử dân tộc, thiên nhiên tươi đẹp và thế giới tuổi thơ trong sáng.', 'khuc-hat-mien-troi-ban-dien-tu-danh-cho-khach-doc-thu', 1, '/data/other/12/Bìa sách/KHUC HAT MIEN TROI/bia khu hat mien troi.png', '/documents/pdf/2025/khuc-hat-mien-troi-ban-dien-tu-danh-cho-khach-doc-thu-1745555713.pdf', NULL, '<p>Với hơn 60 bài thơ viết về tình yêu quê hương, lòng biết ơn tổ tiên và sự ngưỡng mộ đối với những con người đã viết nên sử Việt, Phạm Vân Anh khéo léo mở ra những câu chuyện lịch sử qua góc nhìn trẻ thơ: từ truyền thuyết Lạc Long Quân - Âu Cơ, đến các anh hùng dân tộc như Hai Bà Trưng, Trần Hưng Đạo, Lý Thường Kiệt, Quang Trung...</p>\r\n\r\n<p>Bên cạnh những vần thơ đi cùng dòng chảy lịch sử, \"Khúc hát miền Trời\" còn đưa bạn đọc nhỏ tuổi khám phá vẻ đẹp bình dị của làng quê Việt Nam, tình yêu gia đình, thầy cô, bạn bè và những kỷ niệm êm đềm tuổi học trò.</p>\r\n\r\n<p>Phạm Vân Anh đã sử dụng ngôn ngữ thơ giàu hình ảnh và nhạc điệu, dễ đi vào lòng bạn đọc nhỏ. Mỗi bài thơ là một câu chuyện kể, vừa dễ tiếp nhận vừa nuôi dưỡng tâm hồn, hình thành nhân cách và lòng tự hào dân tộc. \"Khúc hát miền Trời\" được ra mắt bạn đọc đúng dịp kỷ niệm 50 năm ngày non sông nối liền một dải, không chỉ là món quà dành cho thiếu nhi mà còn là tài liệu giáo dục giá trị truyền thống dân tộc đầy cảm xúc.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tập thơ do Nhà xuất bản Hội Nhà văn cấp phép, Công ty WAKA sản xuất và phát hành.</p>\r\n\r\n<p>Bạn đọc quan tâm có thể đặt mua sách điện tử và sách nói tại:</p>\r\n\r\n<p>Sách điện tử:&nbsp;<a href=\"https://waka.vn/ebook/khuc-hat-mien-troi-bz7vZW.html\">https://waka.vn/ebook/khuc-hat-mien-troi-bz7vZW.html</a></p>\r\n\r\n<p>Sách nói:&nbsp;<a href=\"https://waka.vn/sach-noi/khuc-hat-mien-troi-bYxQ8\">https://waka.vn/sach-noi/khuc-hat-mien-troi-bYxQ8</a></p>', NULL, '', 62, 126, '', 0, NULL, 49000, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025', '2025', NULL, 'Việt Nam', NULL, NULL, 2, NULL, 1, ',0,1,2,', 13, 330, 0, 120, 12, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, '2025-04-25 04:35:13', '2025-10-14 08:54:56', 12, 12, 12),
