(68, 53, 'BT cuốn Người TV', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tập truyện ngắn của Murakami viết về giới trẻ Nhật Bản với những góc nhìn mới, quan niệm mới về con người, đời sống xã hội, về tình yêu; thể hiện&nbsp; mong muốn được cởi bỏ những ràng buộc văn hoá truyền thống Nhật Bản, hướng tới tiếp cận những lối sống mới, thị hiếu mới của phương Tây. Tập truyện có yếu tố siêu thực, hấp dẫn.</span></span></span></span></p>', '9,24,28,29,7,8', '4,11', 0, 'complete', '2024-07-24 11:43:00', NULL, NULL, 29, 29, '2024-07-24 04:44:42', '2024-07-30 04:33:51'),
