(70, 55, 'họp BBt', '<p>Vì tình hình&nbsp; Ban Biên tập nhiều người bị covid nên cuộc họp BBT bàn về dự án chiều 29.07 tạm hoãn đến khi có thông báo mới.</p>\r\n\r\n<p>Trân trọng thông báo!</p>', '9,10,24,28,29,30', '4', 0, 'complete', '2024-07-29 14:00:00', NULL, NULL, 5, 5, '2024-07-24 05:26:43', '2024-08-14 02:56:23'),
(71, 53, 'Bt cuốn Carrie - vũ hội đẫm máu', '<p class=\"pbody\" style=\"margin-top:18px; margin-bottom:18px\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"vertical-align:baseline\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tác phẩm thuộc thể loại kinh dị - siêu nhiên, kể về nỗi đau đớn của một cô gái tuổi teen nhút nhát, đến trường thường bị bạn bè bắt nạt, ở nhà thì có một người mẹ cuồng tín đối xử tệ bạc. Cô bé cố gắng chịu đựng sự tổn thương cho đến một ngày phát hiện mình là người siêu năng lực, có thể điều khiển được mọi thứ. Cô dùng vũ khí siêu năng lực của mình để trả thù.</span></span></span></span></p>\r\n\r\n<p class=\"pbody\" style=\"margin-top:18px; margin-bottom:18px\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"vertical-align:baseline\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tác phẩm thể hiện khao khát được sống, được đối xử công bằng như mọi người của một cô bé trước ngưỡng cửa vào đời. Tác phẩm cũng có ý nghĩa cảnh tỉnh con người trước cái xấu, cái ác.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:17:00', NULL, NULL, 29, 29, '2024-07-24 07:19:11', '2024-07-30 04:33:16'),
(72, 53, 'Tập truyện ngắn Hoa suối ngầm', NULL, '9,10,24,28,29,30,5,7,8', '4,11', 0, 'processing', '2024-07-24 14:19:00', NULL, NULL, 29, 29, '2024-07-24 07:19:59', '2024-07-24 08:19:43'),
(73, 53, 'tập ký Muôn nẻo đường đi', NULL, '9,10,24,28,29,30,5,7,8', '4,11', 0, 'processing', '2024-07-24 14:20:00', NULL, NULL, 29, 29, '2024-07-24 07:20:40', '2024-07-24 08:20:28'),
(74, 53, 'Tập thơ Tiếng tơ lòng', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tập thơ của hai tác giả nữ, nội dung chủ yếu viết về tình yêu, tình người, một phần viết ca ngợi các nhân vật lịch sử có công lao với đất nước; cùng một số lời bình của hai tác giả bình thơ của nhau. Tập thơ có nội dung trong sáng, nhân văn.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:20:00', NULL, NULL, 29, 29, '2024-07-24 07:21:06', '2024-07-30 04:32:47'),
(75, 53, 'Tập thơ chiều nghiêng mái phố', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tập thơ viết về những trải nghiệm cảm xúc của tác giả qua nhiều miền đất nước, nhiều nơi trên thế giới; viết về tình người, tình đời, những quan sát, suy ngẫm của tác giả về cuộc sống xã hội và con người. Tập thơ có nội dung tốt, giàu ý nghĩa nhân văn.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:21:00', NULL, NULL, 29, 29, '2024-07-24 07:21:28', '2024-07-30 04:34:40'),
(76, 53, 'tập thơ Về khái niệm', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tập thơ của một tác giả trẻ, thể hiện những trải nghiệm cảm xúc mới mẻ, những hoài nghi của một người trẻ chập chững vào đời và cũng đang bước những bước chân đầu tiên trên con đường nghệ thuật. Tập thơ giàu suy tư, trăn trở và thể hiện nhiều băn khoăn, nghi vấn của một người đang đi tìm chính mình trong thế giới hiện thực.</span></span></span></span></p>\r\n\r\n<p style=\"margin-top:5px\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Chờ anh Yên Ba và anh Đoàn đọc duyệt.</span></font></p>', '5,7,8', '11', 0, 'processing', '2024-07-24 14:21:00', NULL, NULL, 29, 29, '2024-07-24 07:22:06', '2024-07-30 06:59:57'),
(77, 53, 'tiểu thuyết Tình yêu ở thành phố lớn', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tác phẩm viết về trải nghiệm tình yêu đồng giới của một nhà văn trẻ, muốn thông qua tác phẩm để kể lại một quãng trong hành trình cuộc đời mình: tìm cách giải mã bản thân; tìm câu trả lời cho những nghi vấn về tình yêu, cuộc sống, con người; cuối cùng, tìm cho mình một tình yêu đích thực. Tác phẩm có nội dung tốt, giàu tính nhân văn.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:22:00', NULL, NULL, 29, 29, '2024-07-24 07:22:42', '2024-07-30 04:34:12'),
(78, 53, 'tập truyện Báu vật truyền đời', '<p>Tập truyện ngắn viết về đời sống xã hội, những câu chuyện gia đình, chuyện cuộc sống thường ngày.</p>\r\n\r\n<p>Đang chờ trao đổi với tác giả về việc chỉnh sửa.</p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'processing', '2024-07-24 14:22:00', NULL, NULL, 29, 29, '2024-07-24 07:23:22', '2024-07-30 07:03:55'),
(79, 53, 'Tập thơ Tứ cú tỉnh mộng đời', '<p>Tập thơ của tác giả là một hoà thượng, viết về triết lý nhân sinh, giáo lý nhà Phật; thông qua giáo lý, truyền dạy lẽ sống, đạo đức làm người.</p>\r\n\r\n<p>Đang chờ tác giả xem lại bản biên tập có cắt bỏ một số bài.</p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'processing', '2024-07-24 14:23:00', NULL, NULL, 29, 29, '2024-07-24 07:24:39', '2024-07-30 07:02:26'),
(80, 53, 'Tiểu thuyết Ông nội phiêu lưu ký', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tập truyện dài viết cho thiếu nhi, nội dung xoay quanh tình cảm gia đình cùng những tưởng tượng phong phú của trẻ em đối lập với suy nghĩ thực dụng của người lớn. Văn phong trong sáng, hài hước, nhiều màu sắc hoạt kê. Tác phẩm giàu tinh thần nhân văn và ý nghĩa giáo dục.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:28:00', NULL, NULL, 29, 29, '2024-07-24 07:28:38', '2024-07-30 04:37:24'),
(81, 53, 'tiểu thuyết Sóng đời', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Cuốn tiểu thuyết viết về hành trình lập thân, lập nghiệp của một thanh niên nghèo, sống giữa niềm hy vọng của cha mẹ, dòng họ, giữa sự cưu mang, giúp đỡ của những người thân quen, bè bạn, đã vượt qua những khó khăn, thử thách để xây dựng sự nghiệp, đền đáp công ơn cha mẹ và tấm lòng chân thành, bao dung của những người thân.</span></span></span></span></p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:28:00', NULL, NULL, 29, 29, '2024-07-24 07:29:48', '2024-07-30 04:35:22'),
(82, 53, 'hồi ký Từ làng kẻ cài', '<p style=\"margin-top:5px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:dotted 16.0cm\"><span style=\"font-family:VNI-Times\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Từ làng Kẻ Cài là hồi ký của một nhà giáo, là Tiến sỹ Triết học, ghi lại những dấu ấn cuộc đời đi học, trưởng thành, trở thành một nhà giáo trên giảng đường đại học. Nội dung tác phẩm hướng đến tình cảm gia đình, thầy trò, đồng nghiệp, kể lại những trải nghiệm, những tình huống thú vị, nhân văn trong cuộc đời của tác giả.</span></span></span></span></p>\r\n\r\n<p style=\"margin-top:5px\">&nbsp;</p>', '9,10,24,28,29,30,5,7,8', '4,11', 0, 'complete', '2024-07-24 14:38:00', NULL, NULL, 29, 29, '2024-07-24 07:38:58', '2024-07-30 04:36:08'),
